  expected_count: 5
  input: TEXT,F3XN,,"On July 15, 2005, PharMerica Inc. Political Action Committee
    (PPAC) made a contribution in the amount of $2,500 to the Congressional Majority
    Committee (the Committee).  On July 13, 2005, AmerisourceBergen Corporation Political
    Action Committee (ABC PAC), an affiliated committee of PPAC, made a $5,000 contribution
    to the Committee.  As a result, PPAC mistakenly contributed a total of $7,500
    to the Committee in 2005, exceeding the contribution limit by $2,500. On December
    9, 2005, PPAC requested from the Committee a refund in the amount of $2,500, which
    represents the excessive portion of the contribution.  On September 6, 2005, PharMerica
    Inc. Political Action Committee (PPAC) made a contribution in the amount of $2,500
    to the Hatch Election Committee Inc. (the Hatch Committee) in connection with
    the 2006 primary.  Previously, AmerisourceBergen Corporation Political Action
    Committee (ABC PAC), an affiliated committee of PPAC, made contributions to the
    Committee aggregating $5,000 and which were designated for the 2006 primary.  As
    a result, PPAC inadvertently contributed a total of $7,500 to Senator Hatch's
    2006 primary election, exceeding the contribution limit by $2,500. On December
    9, 2005, PPAC requested from the Hatch Committee a refund in the amount of $2,500,
    which represents the excessive portion of the contribution.  Lastly, PPAC officials
    discovered shortly after the close of the reporting period that William Shields
    had exceeded the contribution limit to the PAC in the amount of $.06. The issue
    resulted from a rounding error by the payroll processor for the PAC when calculating
    his deductions. The PAC refunded the excess contribution on January 12, 2006 and
    it will be reported on the PAC's first quarter report."
